import { registerIcon } from "@ui5/webcomponents-base/dist/asset-registries/Icons.js";

const name = "navigation-right-arrow";
const pathData = "M274 257L172 155c-6-7-9-14-9-22s3-16 9-22 14-9 22-9c7 0 15 3 21 9l124 124c7 6 10 14 10 22s-3 15-10 22L215 403c-6 6-14 9-21 9-8 0-16-3-22-9-6-7-9-14-9-22s3-16 9-22z";
const ltr = false;
const collection = "SAP-icons-v5";
const packageName = "@ui5/webcomponents-icons";

registerIcon(name, { pathData, ltr, collection, packageName });

export default { pathData };
